import React from "react";
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link,
    useRouteMatch
} from "react-router-dom";
import Products from "../Screens/products"
export default function CustomLinkExample() {
    return (
        <Router>
            <Switch>
                <Route exact path="/">
                    <Products />
                </Route>
                <Route path="/about">
                <Products />
                </Route>
            </Switch>
        </Router>
    );
}
